import React, { PureComponent } from 'react';
import { WriterWrapper } from '../style';
class Writer extends PureComponent {
    render() {
        return (
            <WriterWrapper>
                <WriterItem>
                <img className="pic" alt=''></img>
                <WriterInfo>
                    <h4 className="title"></h4>
                    <p className="like"></p>
                </WriterInfo>
                </WriterItem>
            </WriterWrapper>
        )
    }
}

export default Writer;
